pragma solidity ^0.8.0;
import "./Admin.sol";
import "./utils/math/SafeMath.sol";

interface AmbsToken {
    function balanceOf(address account) external view returns (uint256);

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool);

    function forcedBurn(address account, uint256 amount) external;
}

contract AmbsStore is Admin {
    using SafeMath for uint256;
    uint256 public ambsPrice = 19 ether;
    uint256 public totalAmbsSold = 0;

    address public ambrosiaTokenAddress;

    event AmbsBought(address receiver, uint256 qty);

    constructor(address[] memory _initAdmins) public Admin(_initAdmins) {}

    function buyAmbs(address receiver, uint256 qty) public payable {
        uint256 price = qty.mul(ambsPrice);
        require(msg.value >= price, "not enough value");

        uint256 payback = uint256(msg.value).sub(price);
        if (payback > 0) {
            payable(msg.sender).transfer(payback);
        }

        totalAmbsSold = totalAmbsSold + qty;

        emit AmbsBought(receiver, qty);
        _claimRevenue();
    }

    function exchangeFromAmbrosiaToken(address receiver, uint256 qty)
        public
        payable
    {
        uint256 balance = AmbsToken(ambrosiaTokenAddress).balanceOf(msg.sender);
        uint256 price = qty * 10**18;
        require(balance >= price, "insufficient funds!");

        AmbsToken(ambrosiaTokenAddress).forcedBurn(msg.sender, price);

        emit AmbsBought(receiver, qty);
    }

    function setAmbsPrice(uint256 newPrice) public onlyAdmin(msg.sender) {
        ambsPrice = newPrice;
    }

    function setAmbrosiaTokenAddress(address _ambrosiaTokenAddress)
        public
        onlyAdmin(msg.sender)
    {
        ambrosiaTokenAddress = _ambrosiaTokenAddress;
    }
}
